import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  ScrollView,
  SafeAreaView,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { globalStyles } from '../styles/globalStyles';

interface DrawerItem {
  id: number;
  title: string;
  icon: keyof typeof import('@expo/vector-icons').Ionicons.glyphMap;
  color: string;
}

interface CustomDrawerProps {
  onClose: () => void;
  onLogout: () => void;
  onNavigateToComplaint: () => void;
  onNavigateToMaterialRequisition: () => void;
  onNavigateToLeave: () => void;
  onNavigateToTravelling: () => void;
  onNavigateToAddCustomer: () => void;
  onNavigateToCreateAMC: () => void;
  onNavigateToViewAttendance: () => void;
  onShowTips: () => void;
}

const CustomDrawer: React.FC<CustomDrawerProps> = ({ onClose, onLogout, onNavigateToComplaint, onNavigateToMaterialRequisition, onNavigateToLeave, onNavigateToTravelling, onNavigateToAddCustomer, onNavigateToCreateAMC, onNavigateToViewAttendance, onShowTips }) => {
  const menuItems: DrawerItem[] = [
    {
      id: 1,
      title: 'Add Complaint',
      icon: 'call-outline' as const,
      color: '#3498db',
    },
    {
      id: 2,
      title: 'Material Requisition',
      icon: 'add-circle-outline' as const,
      color: '#9b59b6',
    },
    {
      id: 3,
      title: 'Leave',
      icon: 'umbrella-outline' as const,
      color: '#e67e22',
    },
    {
      id: 4,
      title: 'Travelling',
      icon: 'airplane-outline' as const,
      color: '#1abc9c',
    },
    {
      id: 5,
      title: 'Add Customer',
      icon: 'person-add-outline' as const,
      color: '#e74c3c',
    },
    {
      id: 6,
      title: 'Create AMC',
      icon: 'calendar-outline' as const,
      color: '#f39c12',
    },
    {
      id: 7,
      title: 'View Attendance',
      icon: 'pie-chart-outline' as const,
      color: '#2ecc71',
    },
  ];

  const handleMenuPress = (item: DrawerItem): void => {
    console.log(`Pressed: ${item.title}`);
    if (item.title === 'Add Complaint') {
      onNavigateToComplaint();
    } else if (item.title === 'Material Requisition') {
      onNavigateToMaterialRequisition();
    } else if (item.title === 'Leave') {
      onNavigateToLeave();
    } else if (item.title === 'Travelling') {
      onNavigateToTravelling();
    } else if (item.title === 'Add Customer') {
      onNavigateToAddCustomer();
    } else if (item.title === 'Create AMC') {
      onNavigateToCreateAMC();
    } else if (item.title === 'View Attendance') {
      onNavigateToViewAttendance();
    } else if (item.title === 'App Tips') {
      onShowTips();
    }
    onClose(); // Close drawer after selection
  };

  return (
    <SafeAreaView style={globalStyles.drawerContainer}>
      {/* Header Section */}
      <View style={globalStyles.drawerHeader}>
        <View style={globalStyles.drawerUserInfo}>
          <View style={{
            width: 50,
            height: 50,
            borderRadius: 25,
            backgroundColor: 'rgba(255, 255, 255, 0.2)',
            justifyContent: 'center',
            alignItems: 'center',
            marginRight: 15,
          }}>
            <Ionicons name="person-outline" size={28} color="#fff" />
          </View>
          <View style={{ flex: 1 }}>
            <Text style={globalStyles.drawerUserName}>soundahr</Text>
            <View style={globalStyles.drawerPhoneInfo}>
              <Ionicons name="call-outline" size={14} color="#fff" />
              <Text style={globalStyles.drawerPhoneNumber}>*******4821</Text>
            </View>
          </View>
        </View>
      </View>

      {/* Menu Items */}
      <ScrollView style={globalStyles.drawerMenuContainer} showsVerticalScrollIndicator={false}>
        {menuItems.map((item) => (
          <TouchableOpacity
            key={item.id}
            style={{
              flexDirection: 'row',
              alignItems: 'center',
              justifyContent: 'space-between',
              paddingVertical: 16,
              paddingHorizontal: 20,
              borderBottomWidth: 0.5,
              borderBottomColor: '#e8e8e8',
              backgroundColor: '#fff',
            }}
            onPress={() => handleMenuPress(item)}
          >
            <View style={{
              flexDirection: 'row',
              alignItems: 'center',
              flex: 1,
            }}>
              <View style={{
                width: 40,
                height: 40,
                borderRadius: 20,
                backgroundColor: item.color,
                justifyContent: 'center',
                alignItems: 'center',
                marginRight: 16,
              }}>
                <Ionicons name={item.icon} size={20} color="#fff" />
              </View>
              <Text style={{
                fontSize: 16,
                color: '#2c3e50',
                fontWeight: '600',
              }}>{item.title}</Text>
            </View>
            <Ionicons name="chevron-forward" size={16} color="#bdc3c7" />
          </TouchableOpacity>
        ))}

        {/* Logout Item */}
        <TouchableOpacity style={{
          flexDirection: 'row',
          alignItems: 'center',
          justifyContent: 'space-between',
          paddingVertical: 16,
          paddingHorizontal: 20,
          borderBottomWidth: 0.5,
          borderBottomColor: '#e8e8e8',
          backgroundColor: '#fff',
          marginTop: 10,
        }} onPress={onLogout}>
          <View style={{
            flexDirection: 'row',
            alignItems: 'center',
            flex: 1,
          }}>
            <View style={{
              width: 40,
              height: 40,
              borderRadius: 20,
              backgroundColor: '#e74c3c',
              justifyContent: 'center',
              alignItems: 'center',
              marginRight: 16,
            }}>
              <Ionicons name="log-out-outline" size={20} color="#fff" />
            </View>
            <Text style={{
              fontSize: 16,
              color: '#e74c3c',
              fontWeight: '600',
            }}>Logout</Text>
          </View>
          <Ionicons name="chevron-forward" size={16} color="#bdc3c7" />
        </TouchableOpacity>

        {/* Separator */}
        <View style={globalStyles.drawerSeparator} />

        {/* App Tips */}
        <TouchableOpacity 
          style={{
            paddingHorizontal: 20,
            marginBottom: 20,
            backgroundColor: '#fff',
            borderRadius: 12,
            marginHorizontal: 20,
            paddingVertical: 16,
            shadowColor: '#000',
            shadowOffset: {
              width: 0,
              height: 2,
            },
            shadowOpacity: 0.1,
            shadowRadius: 4,
            elevation: 3,
          }}
          onPress={() => handleMenuPress({ id: 8, title: 'App Tips', icon: 'bulb-outline', color: '#f39c12' })}
        >
          <View style={{
            flexDirection: 'row',
            alignItems: 'center',
          }}>
            <Ionicons name="bulb-outline" size={20} color="#f39c12" />
            <Text style={{
              fontSize: 16,
              color: '#2c3e50',
              fontWeight: '600',
              marginLeft: 12,
            }}>App Tips</Text>
          </View>
        </TouchableOpacity>

        {/* Developer Info */}
        <View style={globalStyles.drawerDeveloperInfo}>
          <Text style={globalStyles.drawerDeveloperText}>Designed & Developed By</Text>
          <Text style={globalStyles.drawerCompanyName}>Lionsol Infoway Pvt. Ltd.</Text>
          <Text style={globalStyles.drawerWebsite}>https://lionsol.in</Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

export default CustomDrawer;
